काठमाडौं क्षेत्र नम्बर ४ मा नेकपा एमालेका राजन भट्टराई र नेपाली कांग्रेसका सचिन तिमिल्सिनाले उम्मेदवारी दर्ता गरेका छन् ।

उनीहरूले मंगलबार मनोनयन दर्ताको समय अन्तिम चरणमा पुगेका बेला उम्मेदवारी दर्ता गरेका हुन् ।&amp;nbsp;

यो क्षेत्रबाट अघिल्लोपटक

काठमाडौं क्षेत्र नम्बर २ मा नेपाली कांग्रेसबाट कविर शर्माले उम्मेदवारी दर्ता गराएका छन् ।&amp;nbsp;

मंगलबार उम्मेदवारी मनोनयनको अन्तिम समयमा कांग्रेसले काठमाडौं क्षेत्र २ को उम्मेदवार टुंगो लगाएपछि शर्माले टिकट पाएका हुन् ।&amp;nbsp;

करिब सबै दलका

काठमाडौं क्षेत्र नम्बर ९ मा नेकपा एमालेका डा. अजयक्रान्ति शाक्यले उम्मेदवारी दर्ता गरेका छन् ।

उनले चन्द्रागिरि नगरपालिकाको कार्यालयमा रहेको निर्वाचन अधिकृतको कार्यालयमा पुगेर मंगलबार दिउँसो उम्मेदवारी दर्ता गराएका हुन् ।&amp;nbsp;

उनीसँगै निवर्तमा

काठमाडौँ । सञ्चार तथा सूचना प्रविधिमन्त्री जगदिश खरेलले पदबाट राजीनामा दिएका छन् ।

ललितपुर-२ बाट प्रतिनिधिसभा सभा निर्वाचन लड्ने निश्चित भएपछि खरेलले प्रधानमन्त्री सुशीला कार्कीलाई राजीनामा पत्र बुझाएका हुन् ।&amp;nbsp;

